CREATE TABLE tbase:informix.catrn_dbs03 (
	catrnntra serial NOT NULL,
	catrnftra date NOT NULL,
	catrnncta char(10) NOT NULL,
	catrnndoc decimal(10,0),
	catrnmorg decimal(2,0),
	catrntorg decimal(10,0),
	catrnpref decimal(2,0) NOT NULL,
	catrncorr decimal(3,0) NOT NULL,
	catrnimpo decimal(14,2) NOT NULL,
	catrnimpt decimal(14,2) NOT NULL,
	catrncbio float,
	catrncmon decimal(2,0) NOT NULL,
	catrnglos char(90),
	catrnstat decimal(1,0) NOT NULL,
	catrnplaz smallint,
	catrnagen smallint,
	catrnuser char(3),
	catrnhora char(8),
	catrnfpro date
)   

SELECT *FROM catrn_dbs03

load FROM catrn_dbs03.txt INSERT INTO catrn

SELECT *FROM catrn ORDER BY 1 DESC 


SELECT *
FROM catrn a
WHERE a.catrnftra = today
AND EXISTS (SELECT *
			FROM catrn_dbs03 b
			WHERE b.catrnntra = a.catrnntra
			AND b.catrnncta = a.catrnncta
			AND b.catrnimpo = a.catrnimpo)

SELECT *
FROM catrn_dbs03 a
WHERE a.catrnftra = today
AND NOT EXISTS (SELECT *
			FROM catrn b
			WHERE b.catrnntra = a.catrnntra
			AND b.catrnncta = a.catrnncta
			AND b.catrnimpo = a.catrnimpo)
ORDER BY 1;

DELETE catrn_dbs03

SELECT *
FROM catrn
ORDER BY 1 DESC 

